actionConfiguration.body:
() => {
  let locations = [];
  for (let i = 0; i < customer_details_query.data.length; i++) {
    let raw_string = customer_details_query.data[i].LOCATION.split(",");
    let location = {};
    location.lat = parseFloat(raw_string[0]);
    location.long = parseFloat(raw_string[1]);
    location.title = parseInt(customer_details_query.data[i].rowIndex);
    locations.push(location);
  }
  return locations;
}

